## II. SYMMETRY-PROTECTED LANDAU-ZENER-STÜCKELBERG-MAJORANA INTERFERENCE

We begin with a generic TLS described by the timedependent Hamiltonian $(\hbar=1)$

$$
\hat{H}(t) / J=d_{0}(t) \hat{\sigma}_{0}+d_{\varphi}(t) \hat{\sigma}_{x}+d_{y}(t) \hat{\sigma}_{y}+d_{z}(t) \hat{\sigma}_{z}
$$

and the evolution of wave function is given by

$$
|\Psi(t)\rangle=\hat{T} e^{-i\int_{0}^{t} \hat{H}(\tau) d \tau}|\Psi(0)\rangle
$$

with the time-ordering operator $\hat{T}$. Here $J(1 / J)$ is energy (evolution time) unit, $\hat{\sigma}_{0}$ is identity matrix, $\hat{\sigma}_{x, y, z}$ are Pauli matrices with basis $\{|0\rangle,|1\rangle\}$, and $d_{0, x, y, z}$ are time-dependent real parameters. We note that when the time-dependent $d_{\alpha=x, y, z}$ satisfies certain conditions, such as associated with a driving along a single axis [60], and even more generally, along any set of axes of the Bloch sphere [61], the LZSM interference as well as the complete destructive condition can be determined exactly. Specifically, the key assumption is that this system preserves chiral-mirror-like symmetry during the evolution, that is

$$
\begin{aligned}
\hat{H}(t) & =-\hat{\sigma}_{r} \hat{H}(T-t) \hat{\sigma}_{r} \\
\hat{\sigma}_{r} & =\sin \theta \cos \varphi \hat{\sigma}_{x}+\sin \theta \sin \varphi \hat{\sigma}_{y}+\cos \theta \hat{\sigma}_{z}
\end{aligned}
$$

where $\theta$ and $\varphi$ are azimuth and elevation angles being able to take arbitrary value, respectively. Thus we can decompose Hamiltonian into

$$
\begin{aligned}
\hat{H}(t) / J & =d_{0}(t) \hat{\sigma}_{0}+d_{\theta}(t) \hat{\sigma}_{\theta}+d_{\varphi}(t) \hat{\sigma}_{\varphi}+d_{r}(t) \hat{\sigma}_{r} \\
\hat{\sigma}_{\theta} & =\cos \theta \cos \varphi \hat{\sigma}_{x}+\cos \theta \sin \varphi \hat{\sigma}_{y}-\sin \theta \hat{\sigma}_{z} \\
\hat{\sigma}_{\varphi} & =-\sin \varphi \hat{\sigma}_{x}+\cos \varphi \hat{\sigma}_{y}
\end{aligned}
$$

where $d_{0, r}(t)=-d_{0, r}(T-t)$ and $d_{\theta, \varphi}(t)=d_{\theta, \varphi}(T-t)$ under the symmetry defined in Eq. (3). For the purpose of generality, we do not specify the precise values of $\theta$ and $\varphi$ here. Under this symmetry, if a non-adiabatic evolution occurs during $\left[t_{i}, t_{f}\right]$ with $0 \leq t_{i}<t_{f} \leq T / 2$, another one will occur in the range $\left[T-t_{f}, T-t_{i}\right]$. Therefore, we can divide the LZSM interference into three stages: two non-adiabatic evolution stages, labeled as I and III, and an adiabatic evolution stage, labeled II, where phase accumulation occurs. Stage II may, in fact, be absent.

To study LZSM interference conveniently, we employ the adiabatic basis $\left\{\left|E_{-}(t)\right\rangle,\left|E_{+}(t)\right\rangle\right\}$ with parallel transport gauge [62], which is eigenstates of
$\hat{H}(t): \quad \hat{H}(t)\left|E_{ \pm}(t)\right\rangle=E_{ \pm}(t)\left|E_{ \pm}(t)\right\rangle$ and satisfy $\left\langle E_{ \pm}(t)\right| \partial_{t}\left|E_{ \pm}(t)\right\rangle=0$, the adiabatic evolution matrix during stage II is given by:

$$
\hat{U}_{\mathrm{II}}=\left(\begin{array}{cc}
e^{-i \phi_{-}} & 0 \\
0 & e^{-i \phi_{+}}
\end{array}\right)=\exp \left(i \phi_{d} \hat{\sigma}_{z}\right)
$$

where $\phi_{d}$ is the dynamical phase accumulated during stage II with

$$
\phi_{+}=-\phi_{-}, \quad \phi_{d}=\phi_{+}=\int_{t_{f}}^{T-t_{f}} E_{+}(t) d t
$$

Here we use the symmetry of the energy spectrum under chiral-mirror-like symmetry, i.e., $E_{ \pm}(t)=-E_{\mp}(T-t)$. Moreover, the chiral-mirror-like symmetry will also enforce a non-trivial relation between two non-adiabatic transition matrices. That is the transition matrix for stages I will take the form:

$$
\hat{U}_{\mathrm{I}}=e^{-i \gamma\left(t_{f}\right) \hat{\sigma}_{z}}\left(\begin{array}{cc}
\mathcal{R} e^{i \phi_{c}} & -\mathcal{T}^{*} e^{i \phi_{c}} \\
\mathcal{T} e^{-i \phi_{c}} & \mathcal{R}^{*} e^{-i \phi_{c}}
\end{array}\right) e^{i \gamma\left(t_{i}\right) \hat{\sigma}_{z}}
$$

and the one for stages III will be

$$
\hat{U}_{\mathrm{III}}=e^{-i \gamma\left(t_{i}\right) \hat{\sigma}_{z}}\left(\begin{array}{cc}
\mathcal{R} e^{i \phi_{c}} & -\mathcal{T} e^{-i \phi_{c}} \\
\mathcal{T}^{*} e^{i \phi_{c}} & \mathcal{R}^{*} e^{-i \phi_{c}}
\end{array}\right) e^{i \gamma\left(t_{f}\right) \hat{\sigma}_{z}}
$$

where the reflection coefficient $\mathcal{R}$ and transmission coefficient $\mathcal{T}$ can be extracted as $\mathcal{R}=\left\langle\mathcal{E}_{-}\left(t_{f}\right) \mid \Psi\left(t_{f}\right)\right\rangle$ and $\mathcal{T}=\left\langle\mathcal{E}_{+}\left(t_{f}\right) \mid \Psi\left(t_{f}\right)\right\rangle$ when the initial state is set as ground state of $\hat{H}(0)$. Here $\left|\mathcal{E}_{ \pm}\left(t_{f}\right)\right\rangle$ is from adiabatic basis with more easily obtained gauge satisfying $\operatorname{Im}\left[\left\langle\mathcal{E}_{+}\left(t_{f}\right) \mid 0\right\rangle\left\langle 0 \mid \mathcal{E}_{-}\left(t_{f}\right)\right\rangle\right]=0$ and $\operatorname{det}\left[\left|\mathcal{E}_{-}\left(t_{f}\right)\right\rangle,\left|\mathcal{E}_{+}\left(t_{f}\right)\right\rangle\right]=1$. In addition, $\gamma\left(t_{i}\right), \gamma\left(t_{f}\right)$ and $\phi_{c} \equiv \frac{1}{2} \arg (\cos \theta+i \sin \theta \sin \vartheta)$ with $\vartheta \equiv \arg \left[d_{\theta}(T / 2)-\right.$ $\left.id_{\varphi}(T / 2)\right]\left(d_{\theta}\right.$ and $d_{\varphi}$ defined in Eq. (4)) are the phase factors from gauge transformation (see appendix A). We note that $\phi_{c}=0$ and $\pi / 4$ when $\theta=0$ and $\theta=\pi / 2$, respectively, independent of detail of Hamiltonian, while other cases are just dependent on Hamiltonian at halftime point $\hat{H}(T / 2)$.

Now, we can obtain the complete evolution matrix of the LZSM interference conveniently by the TM method [6], where each stage is attributed to the respective matrices, that is

$$
\hat{U}=\hat{U}_{\mathrm{III}} \hat{U}_{\mathrm{II}} \hat{U}_{\mathrm{I}}=e^{-i \gamma\left(t_{i}\right) \hat{\sigma}_{z}} \hat{\mathcal{U}} e^{i \gamma\left(t_{i}\right) \hat{\sigma}_{z}}
$$

with

$$
\hat{U}=\left(\begin{array}{cc}
U_{11} & U_{12} \\
U_{21} & U_{22}
\end{array}\right), \quad \hat{\mathcal{U}}=\left(\begin{array}{cc}
\mathcal{U}_{11} & \mathcal{U}_{12} \\
\mathcal{U}_{21} & \mathcal{U}_{22}
\end{array}\right)
$$

where

$$
\begin{aligned}
\mathcal{U}_{11} & =\mathcal{U}_{22}^{*}=\mathcal{R}^{2} e^{i\left(\phi_{d}+2 \phi_{c}\right)}-\mathcal{T}^{2} e^{-i\left(\phi_{d}+2 \phi_{c}\right)} \\
\mathcal{U}_{21} & =-\mathcal{U}_{12}=\mathcal{R} \mathcal{T}^{*} e^{i\left(\phi_{d}+2 \phi_{c}\right)}+\mathcal{R}^{*} \mathcal{T} e^{-i\left(\phi_{d}+2 \phi_{c}\right)}
\end{aligned}
$$

Thereby if we start from the ground state $\left|E_{-}\right\rangle$, the probability $\mathcal{P}_{-+}$of finding the system in its excited state $\left|E_{+}\right\rangle$ and remaining in the ground state $\mathcal{P}_{--}$will be

$$
\begin{aligned}
\mathcal{P}_{-+} & =\left|U_{21}\right|^{2}=\left|\mathcal{U}_{21}\right|^{2}=4|\mathcal{R}|^{2}|\mathcal{T}|^{2} \cos ^{2} \phi_{\mathcal{L}} \\
\mathcal{P}_{--} & =\left|U_{11}\right|^{2}=\left|\mathcal{U}_{11}\right|^{2}=1-\mathcal{P}_{-+} \\
\phi_{\mathcal{L}} & =\phi_{d}+2 \phi_{c}+\phi_{r}
\end{aligned}
$$

with $\phi_{r}=\arg \left(\mathcal{R} \mathcal{T}^{*}\right)$ is the relative phase between the reflection coefficient $\mathcal{R}$ and transmission coefficient $\mathcal{T}$.

As such, the complete destructive LZSM interference corresponding to $\mathcal{P}_{--}=1$ is achieved when $\phi_{\mathcal{L}}=$ $(n+1 / 2) \pi$, with $n$ being an integer. After this process, the end state will be ground state of $\hat{H}(T)$ after LZSM interference. However, this result will be associated with distinct significance associated with different relation between initial Hamiltonian $\hat{H}(0)$ and symmetric operator $\hat{\sigma}_{r}$. For example, this end state will come back to initial states if they form anticommutation relation $\left[\hat{H}(0), \hat{\sigma}_{r}\right]_{+}=0$. And more importantly, when they commutate with each other $\left[\hat{H}(0), \hat{\sigma}_{r}\right]=0$, indicating $\hat{H}(T)=-\hat{H}(0)$, this process actually is associated with a state transition $\left|E_{-}(0)\right\rangle \rightarrow\left|E_{-}(T)\right\rangle=\left|E_{+}(0)\right\rangle$. In following of this work, we will mainly focus on the latter situation.
